import { BrowserRouter, Routes, Route } from "react-router-dom";
import HomeSpace from "./HomeSpace";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<HomeSpace />} index />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
